function harsam(){if(document.getElementById("dia").value==""){alert("Entre com o dia desejado.");return false}if(document.getElementById("dia").value<1||(document.getElementById("dia").value>31)){alert("Valor inválido!");return false}if(document.getElementById("mes").value==""){alert("Entre com o mês desejado.");return false}if(document.getElementById("mes").value==2&&(document.getElementById("dia").value>29)){alert("O valor do dia informado para o mês de Fevereiro está incorreto.");return false}if(document.getElementById("mes").value<1||(document.getElementById("mes").value>12)){alert("Valor inválido!");return false}if(document.getElementById("ano").value==""){alert("Entre com o ano desejado.");return false}if(document.getElementById("temp1").value==""){alert("Entre com o valor da temperatura as 9h00.");return false}if(document.getElementById("temp2").value==""){alert("Entre com o valor da temperatura as 21h00.");return false}if(document.getElementById("tempMax").value==""){alert("Entre com o valor da temperatura máxima.");return false}if(document.getElementById("tempMin").value==""){alert("Entre com o valor da temperatura mínima.");return false}if(document.getElementById("latitude-graus").value==""){alert("Entre com o valor da latitude em graus.");return false}if(document.getElementById("latitude-min").value==""){alert("Entre com o valor da latitude em minutos.");return false}var r=parseFloat(document.getElementById("dia").value);var c=parseFloat(document.getElementById("mes").value);var k=parseFloat(document.getElementById("ano").value);var s=parseFloat(document.getElementById("temp1").value);var p=parseFloat(document.getElementById("temp2").value);var o=parseFloat(document.getElementById("tempMax").value);var m=parseFloat(document.getElementById("tempMin").value);var l=parseFloat(document.getElementById("latitude-graus").value);var d=parseFloat(document.getElementById("latitude-min").value);var n={janeiro:1,fevereiro:2,marco:3,abril:4,maio:5,junho:6,julho:7,agosto:8,setembro:9,outubro:10,novembro:11,dezembro:12};var g={janeiro:31,fevereiro:28,marco:31,abril:30,maio:31,junho:30,julho:31,agosto:31,setembro:30,outubro:31,novembro:30,dezembro:31};var e=0;if((k%4==0)&&((k%100!=0)||(k%400==0))){if(c==n.janeiro){e=r}if(c==n.fevereiro){e=(g.janeiro+r)}if(c==n.marco){e=(g.janeiro+(g.fevereiro+1)+r)}if(c==n.abril){e=(g.janeiro+(g.fevereiro+1)+g.marco+r)}if(c==n.maio){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+r)}if(c==n.junho){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+r)}if(c==n.julho){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+g.junho+r)}if(c==n.agosto){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+g.junho+g.julho+r)}if(c==n.setembro){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+r)}if(c==n.outubro){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+g.setembro+r)}if(c==n.novembro){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+g.setembro+g.outubro+r)}if(c==n.dezembro){e=(g.janeiro+(g.fevereiro+1)+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+g.setembro+g.outubro+g.novembro+r)}}else{if(c==n.janeiro){e=r}if(c==n.fevereiro){e=(g.janeiro+r)}if(c==n.marco){e=(g.janeiro+g.fevereiro+r)}if(c==n.abril){e=(g.janeiro+g.fevereiro+g.marco+r)}if(c==n.maio){e=(g.janeiro+g.fevereiro+g.marco+g.abril+r)}if(c==n.junho){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+r)}if(c==n.julho){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+g.junho+r)}if(c==n.agosto){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+g.junho+g.julho+r)}if(c==n.setembro){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+r)}if(c==n.outubro){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+g.setembro+r)}if(c==n.novembro){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+g.setembro+g.outubro+r)}if(c==n.dezembro){e=(g.janeiro+g.fevereiro+g.marco+g.abril+g.maio+g.junho+g.julho+g.agosto+g.setembro+g.outubro+g.novembro+r)}}var f;f=((s+o+m+(2*p))/5);var h;if(l>0){h=((l+(d)/60)*(Math.PI/180))}else{h=((l+(-d)/60)*(Math.PI/180))}var b;b=(0.4093*(Math.sin((((2*Math.PI)/365)*e)-1.405)));var a;a=Math.acos((-Math.tan(h))*(Math.tan(b)));var i;i=(1+0.033*(Math.cos(((2*Math.PI)/365)*e)));var j;j=(37.586*i*(a*Math.sin(h)*Math.sin(b)+Math.cos(h)*Math.cos(b)*Math.sin(a)));j=(j/2.45);var q;q=(0.0023*(Math.pow((o-m),0.5))*(f+17.8)*j);document.getElementById("resultado").value=q.toFixed(2)+" mm/dia";return false};